1992年に設立された「CARACTERE AUTOMOBILE」社は、本拠をベルギーに置きAUDI / VW / Porscheのエアロパーツの開発、生産、販売を行うと同時に、その高い生産技術とクオリティを世界各国から評価されおり、ヨーロッパチューナーからのOEM製造元としての実績も多数あるエアロパーツ専門メーカーです。<br><br>「CARACTERE AUTOMOBILE」社の長年のノウハウは取り付け説明書に証明されるように詳細に記載されております。これは車両フィッティングにベストマッチする証でもあるのです。「CARACTERE AUTOMOBILE」社が手掛けるAUDI / VW / Porscheのエアロパーツの特徴は、フルバンパータイプのパーツが大半である事です。自動車メーカーが目覚しい進化を遂げている今、個性豊かなドレスアップをお望みの方にご提案するフルバンパータイプエアロをお楽しみいただけると確信しています。<br><br>※未塗装品素材色　別途塗装が必要になりますのでご注意ください。※対応モデル年式～08年<br><br>対応車種：アウディ　A3/S3　8P系　～08年モデル<br><br>車検対応品<br><br>ボディパーツ | リアスポイラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
